	public int lengthOfLongestSubstring(String s) {
		char[] c = s.toCharArray();
		char[] sub = new char[65536];
		int i, j, max = 0;
		// sub[0] = c[0];
		int left = 0, right = 0,len =0;
		for (i = 0; i < c.length; i++) {
			for (j = left; j < right; j++) {
				if (sub[j] == c[i])
					break;
			}
			len = right - left;
			if ((j-left) == len) {
				sub[right++] = c[i];
				len++;
				if (max < len)
					max = len;
			} else {
				left += (j-left+1);
				sub[right++] = c[i];
			}
		}
		return max;
	}
	
	//暴力解决方法
	public int lengthOfLongestSubstring2(String s) {
        char[] c = s.toCharArray();
		char[] sub = new char[65536];
		int i, j, max = 1;
	//	sub[0] = c[0];
		int len = 1;
		for (int t = 0; t < c.length; t++)
			for (i = t; i < c.length; i++) {
				for (j = 0; j < len; j++) {
					if (sub[j] == c[i])
						break;
				}
				if (j == len) {
					sub[len] = c[i];
					len++;
					if (max < len)
						max = len;
				} else {
//					System.out.println(c[i]);
					sub[0] = c[i];
					len = 1;
				}
			}
		return max;
    }
